  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Upper
  Mississippi River Wildlife and Fish Refuge outlines Refuge accomplishments during
  the 1991 calendar year. The report begins with a summary of the years highlights
  and weather conditions. Land acquisition is covered. The report includes a planning
  section which discusses the master plan and research and investigations. Refuge
  administration is outlined; information about personnel, youth programs, volunteer
  programs, funding, and safety is given. Habitat management is also covered; subjects
  include wetlands, forests, grasslands, and grazing. The wildlife section of the
  report discusses wildlife diversity, endangered and threatened species, waterfowl,
  marsh birds and waterbirds, shorebirds, raptors, other migratory birds, game mammals,
  fisheries resources, wildlife propagation, surplus animal disposal, scientific collections,
  animal control, and marking and bird banding. The public uses of the Refuge described
  in this report include hunting, fishing, trapping, wildlife observation, nonwildlife
  recreation, and law enforcement. The equipment and facilities section of the report
  provides information about rehabilitation and major maintenance. Photographs are
  attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
